import Posts from "../components/Body/Posts";

export const diariesReducer =(diaries = [], action) => {
    switch (action.type) {
        case 'GET-ALL':
            return action.payload;
        case 'CREATE':
            return [...diaries, action.payload];
        default:
            return diaries;
    }
}
